import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

const App = () => {
    return (
        <Router>
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="h6" style={{ flexGrow: 1 }}>
                        Mi Aplicaci√≥n
                    </Typography>
                    <Button color="inherit" component={Link} to="/registrarFuncionariosNuevos">Registrar</Button>
                    <Button color="inherit" component={Link} to="/verFuncionarios">Ver Funcionarios</Button>
                    <Button color="inherit" component={Link} to="/editarFuncionariosExistentes">Editar Funcionarios</Button>
                    <Button color="inherit" component={Link} to="/registroEntradaYSalida">Registrar Entrada/Salida</Button>
                    <Button color="inherit" component={Link} to="/obtenerReportes">Obtener Reportes</Button>
                </Toolbar>
            </AppBar>
            <Routes>
                <Route path="/registrarFuncionariosNuevos" element={<RegistrarFuncionario />} />
                <Route path="/verFuncionarios" element={<VerFuncionarios />} />
                <Route path="/editarFuncionariosExistentes" element={<EditarFuncionario />} />
                <Route path="/registroEntradaYSalida" element={<RegistrarEntradaSalida />} />
                <Route path="/obtenerReportes" element={<Reportes />} />
            </Routes>
        </Router>
    );
};

export default App;
